import React from "react";
import PropTypes from 'prop-types'
import {Link} from "react-router-dom";

const headingStyle = {
    color: 'blue',
};

const Header = (props) => {
    return (
        <div class="post-f-t">
            <div class="collapse">
                <div class="bg-dark p-4">
                    <div>
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item">
                                <Link to="/" className="nav-link">
                                    Home
                                </Link>
                            </li>
                            <li className="nav-item">
                                <Link to="/athlete/add" className="nav-link">
                                    Add athletes
                                </Link>
                            </li>
                            <li className="nav-item">
                                <Link to="/info" className="nav-link">
                                    Information
                                </Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
            <nav className="navbar navbar-dark bg-dark" id="collapsedContent">
                <div className="container">
                    <a href="/" className="navbar-brand">
                        Athletes
                    </a>
                </div>
                <button class="navbar-toggler" type="button" data-togle="collapse" data-target="#collapsedContent" aria-controls="navbarToggleExternalContent"
                    aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
            </nav>
        </div>
    );
};

Header.defaultProps = {
    turvataso: "pieni",
}

Header.propTypes = {
    turvataso: PropTypes.string.isRequired,
};

export default Header;
